import './App.css';
import Header from './components/Header.js';
import Footer from './components/Footer.js';
import { BrowserRouter } from 'react-router-dom';
import Home from './Home'; // Υποθέτω ότι υπάρχει ένας component για την αρχική σελίδα
import About from './About'; // Υποθέτω ότι υπάρχει ένας component για τη σελίδα "About"
import Contact from './Contact'; 

function App() {
  return (
    <div className="App">
      <Header /> 
        <BrowserRouter>
          <Switch>
            <Route path="/" exact component={Home} />
            <Route path="/about" component={About} />
            <Route path="/contact" component={Contact} />
            {/* Μπορείς να προσθέσεις περισσότερα routes εδώ */}
          </Switch>
        </BrowserRouter>
      <Footer />
    </div>
  );
}

export default App;
